class BrokerUser:
    def __init__(self, username):
        self.username = username

    def upload_and_validate_error_message(self, error_message):
        return f"Error message for {self.username}: {error_message}"

    def submit_records(self, recipient_data):
        if recipient_data['duns'] is None:
            return "DUNS error: cannot submit without DUNS"
        else:
            return f"Submitted records for {self.username}"


class FabUser:
    def __init__(self, username):
        self.username = username

    def submit_fabs(self, file_data):
        if file_data['file_extension'] != '.csv':
            return "File-level error: incorrect file extension"
        else:
            return f"FABS submitted for {self.username}"

    def get_submission_status(self):
        return f"Submission status for {self.username}"


class AgencyUser:
    def __init__(self, username):
        self.username = username

    def get_file_level_error(self, file_data):
        if file_data['file_extension'] != '.csv':
            return "File-level error: incorrect file extension"
        else:
            return "No file-level errors"

    def submit_data_elements(self, data_elements):
        if data_elements['data'] == '':
            return "Error: cannot submit empty data elements"
        else:
            return f"Submitted data elements for {self.username}"


